import React, { useState } from 'react';
import axios from 'axios';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faTimes } from '@fortawesome/free-solid-svg-icons';
import './BudgetForm.css';

const BudgetForm = ({ onClose, onBudgetAdded, expenseCategories, isOpen }) => {
  const [newBudget, setNewBudget] = useState({
    category: expenseCategories.length > 0 ? expenseCategories[0].name : '',
    limit: '',
    period: 'monthly'
  });

  const handleSubmit = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem('access_token');
    
    try {
      const response = await axios.post(
        'http://localhost:8000/api/budgets/', 
        { 
          ...newBudget, 
          limit: parseFloat(newBudget.limit) 
        },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      
      onBudgetAdded(response.data);
      setNewBudget({ 
        category: expenseCategories.length > 0 ? expenseCategories[0].name : '',
        limit: '', 
        period: 'monthly' 
      });
      onClose();
    } catch (error) {
      console.error('Error creating budget:', error);
      alert('Failed to create budget. Please try again.');
    }
  };

  if (!isOpen) return null;

  return (
    <div className="modal-overlay">
      <div className="modal">
        <div className="modal-header">
          <h3>Create New Budget</h3>
          <button 
            className="btn-icon" 
            onClick={onClose}
            aria-label="Close"
          >
            <FontAwesomeIcon icon={faTimes} />
          </button>
        </div>
        
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="budget-category">Category</label>
            <select
              id="budget-category"
              name="category"
              value={newBudget.category}
              onChange={(e) => setNewBudget({...newBudget, category: e.target.value})}
              required
            >
              {expenseCategories.map(cat => (
                <option key={cat.name} value={cat.name}>
                  {cat.name.charAt(0).toUpperCase() + cat.name.slice(1)}
                </option>
              ))}
            </select>
          </div>
          
          <div className="form-group">
            <label htmlFor="budget-limit">Amount</label>
            <input
              type="number"
              id="budget-limit"
              name="limit"
              step="0.01"
              min="0.01"
              value={newBudget.limit}
              onChange={(e) => setNewBudget({...newBudget, limit: e.target.value})}
              placeholder="Budget limit"
              required
            />
          </div>
          
          <div className="form-group">
            <label htmlFor="budget-period">Period</label>
            <select
              id="budget-period"
              name="period"
              value={newBudget.period}
              onChange={(e) => setNewBudget({...newBudget, period: e.target.value})}
              required
            >
              <option value="weekly">Weekly</option>
              <option value="monthly">Monthly</option>
              <option value="yearly">Yearly</option>
            </select>
          </div>
          
          <div className="form-actions">
            <button type="submit" className="btn btn-primary">
              Create Budget
            </button>
            <button 
              type="button" 
              className="btn btn-secondary"
              onClick={onClose}
            >
              Cancel
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default BudgetForm;
